    <div className="bg-white shadow-lg shadow-white-500/50 rounded-sm mt-3 ml-3 flex text-black text-center">
    <p className='text-xl font-medium mt-2 ml-3'>Tech Stack</p>
    <div className='flex mt-12 -ml-28'>
    <span className='text-xs'>HTML5</span>    
    </div>
    </div>
  )
}

export default Tech_Stack
